!function(){"use strict";angular.module("App").factory("WindowService",["$window","$document","WindowWidthThreshold",function(n,i,r){return{isLarge:function(){return n.innerWidth>=r.LARGE},isMedium:function(){return n.innerWidth>=r.MEDIUM&&n.innerWidth<r.LARGE},isSmall:function(){return n.innerWidth<r.MEDIUM},isLanding:function(){return i.find("body")[0].scrollTop>n.innerHeight}}}])}();